import React, {useState} from 'react';
import Pages from "./Pagination/Pages";
import "./CarsPageStyle.css"
import CarCard from "./CarsCard/CarsCard";
import axios from "axios";

function CarsPage(props) {
    const [cars, setCars] = useState(undefined);
    let carsCards = []

    axios.get("https://f73a961b5e7a.ngrok.io/cars/get-car-page?page=1&per-page=5").then(it => {
        setCars(it)
        cars.items.forEach(car => {
            carsCards.push(<CarCard name={car.name} />)
        })
        }
    )



    return (
    <div className={"main-container"}>
        <div className={"cars-content"}>

            <div className="container cars-container">
                <div className="row">
                    <CarCard/>
                    <CarCard/>
                    <CarCard/>
                    <CarCard/>
                    <CarCard/>
                    <CarCard/>
                </div>
            </div>

            <Pages />
        </div>

    </div>
    );
}

export default CarsPage;
